import React, { useState, useEffect } from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Navigation from './components/Navigation';
import Home from './components/Home';


const App = () => {
  return (
    <>
      <h1>Hello from App</h1>
      <Navigation />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
        </Switch>
    </>
  );
}

export default App;
